import React from "react";
import ClearIcon from '@mui/icons-material/Clear';

const ToDoList = (props) => {

    return (
    <>
        <div className="todo_style">
            <i 
                className="fa fa-times"
                aria-hidden="true" 
                onClick={() => {
                props.onSelect(props.id);
            }}> <ClearIcon /> </i>
            <li>{props.text}</li>
        </div>

    </>
    );
}

export default ToDoList;
